window.bookSummaryJSON = "<p><b>The final chapter to the addictive Stone Riders series is finally here!</b></p> <p>It’s been two years since I was traded to the Stone Riders Motorcycle Club.</p> <p>While it saved my life, I was forced to leave behind the only person that ever mattered to me.</p> <p>Dripping with tattoos, his hair as dark as his soul, the brooding president of the Death Raiders still holds my heart… even if he doesn't seem to know what to do with it.</p> <p>Yet, Silas has watched me from afar for years, always protecting me from a distance and creating havoc on my tattered emotions.</p> <p>To love and be loved an arm's length away has been torture…until it seemed we might finally free ourselves of this pain.</p> <p>Unfortunately, whatever we wanted or could have dreamed of having gets ripped out of reach when old enemies return.</p> <p>While one wants power, the other…<b> </b><b><i>only wants me.</i></b></p> <p>I’ll grieve the dream of a future with Silas because if there’s one thing I know, it's that there is no world in which he would ever share me with another.</p> <p><b>If this is to be our end, then I'll say goodbye with ink-stained arms wrapped around me and death itself still holding my heart.</b></p> <p><i>While each book in this series can be enjoyed as a standalone, this book is the exception. The plot from books one through three will come to an end with this book, so it is highly recommended to listen to them in order to fully enjoy and understand what's happening in</i> Where We Ended<i>.</i></p>"; 
